import "./App.css";
import Col from "react-bootstrap/Col";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import vector3 from "./images/Vector 3.png";
import vector4 from "./images/Vector 4.png";
import logo from "./images/logo.PNG";

const imageStyle = {
  position: "absolute",
  top: 0, // Ajustez la position verticale au besoin
  right: 0, // Positionner l'image tout à droite de l'écran
};
const logoStyle = {
  marginTop: 200,
};

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col className="justify-content-end" sm={12}>
            <div>
              <img src={vector3} alt="Vector 3" style={imageStyle} />
            </div>
            <div>
              <img src={vector4} alt="Vector 4" style={imageStyle} />
            </div>
          </Col>
          <Col className="justify-content-center" sm={12} style={logoStyle}>
            <img src={logo} alt="logo" />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
